import dummy from "../db/data.json";

export default function Day()
{
    const day = 1;
    const wordList = dummy.words.filter(word =>
        (
            word.day === day
        ))
    console.log(wordList);

    return <>
    <table>
        <tbody>
        {dummy.words.map(word => (
            <tr>
                <td>
                    {word.eng}
                </td>
                <td>
                    {word.kor}
                </td>
            </tr>
        ))}
        </tbody>
    </table>
    </>;
}
